/**
 * Wix-Style Animations and Interactions
 * Includes: Scroll animations, parallax effects, entrance animations, hover effects
 */

// ===== SCROLL-DRIVEN ANIMATIONS =====
class ScrollAnimations {
    constructor() {
        this.elements = document.querySelectorAll('[data-scroll-animate]');
        this.init();
    }

    init() {
        // Create Intersection Observer for entrance animations
        const observerOptions = {
            root: null,
            rootMargin: '0px',
            threshold: 0.1,
        };

        this.observer = new IntersectionObserver((entries) => {
            entries.forEach((entry) => {
                if (entry.isIntersecting) {
                    entry.target.classList.add('animate-in');
                }
            });
        }, observerOptions);

        // Observe all elements with scroll animation attribute
        this.elements.forEach((el) => this.observer.observe(el));

        // Add scroll listener for parallax
        this.scrollHandler = () => this.handleScroll();
        window.addEventListener('scroll', this.scrollHandler);
    }

    cleanup() {
        // Remove scroll listener
        if (this.scrollHandler) {
            window.removeEventListener('scroll', this.scrollHandler);
            this.scrollHandler = null;
        }

        // Disconnect observer
        if (this.observer) {
            this.observer.disconnect();
            this.observer = null;
        }
    }

    handleScroll() {
        const scrolled = window.pageYOffset;

        // Parallax effect for images
        document.querySelectorAll('[data-parallax]').forEach((el) => {
            const speed = el.dataset.parallaxSpeed || 0.5;
            const yPos = -(scrolled * speed);
            el.style.transform = `translate3d(0, ${yPos}px, 0)`;
        });

        // Fade in/out effects based on scroll position
        document.querySelectorAll('[data-fade-scroll]').forEach((el) => {
            const rect = el.getBoundingClientRect();
            const windowHeight = window.innerHeight;
            const fadeStart = windowHeight * 0.8;
            const fadeEnd = windowHeight * 0.2;

            if (rect.top < fadeStart && rect.bottom > fadeEnd) {
                const opacity = Math.min(1, (fadeStart - rect.top) / (fadeStart - fadeEnd));
                el.style.opacity = opacity;
            }
        });
    }
}

// ===== ENTRANCE ANIMATIONS =====
class EntranceAnimations {
    constructor() {
        this.animationTypes = [
            'fadeIn',
            'slideUp',
            'slideDown',
            'slideLeft',
            'slideRight',
            'zoomIn',
        ];
        this.init();
    }

    init() {
        document.querySelectorAll('[data-entrance]').forEach((el, index) => {
            const animationType = el.dataset.entrance || 'fadeIn';
            const delay = el.dataset.entranceDelay || index * 100;

            el.style.opacity = '0';
            el.style.transition = `all 0.8s cubic-bezier(0.4, 0, 0.2, 1) ${delay}ms`;

            const observer = new IntersectionObserver(
                (entries) => {
                    entries.forEach((entry) => {
                        if (entry.isIntersecting) {
                            this.applyAnimation(entry.target, animationType);
                            observer.unobserve(entry.target);
                        }
                    });
                },
                { threshold: 0.1 }
            );

            observer.observe(el);
        });
    }

    applyAnimation(el, type) {
        el.style.opacity = '1';

        switch (type) {
            case 'slideUp':
                el.style.transform = 'translateY(50px)';
                setTimeout(() => {
                    el.style.transform = 'translateY(0)';
                }, 10);
                break;
            case 'slideDown':
                el.style.transform = 'translateY(-50px)';
                setTimeout(() => {
                    el.style.transform = 'translateY(0)';
                }, 10);
                break;
            case 'slideLeft':
                el.style.transform = 'translateX(50px)';
                setTimeout(() => {
                    el.style.transform = 'translateX(0)';
                }, 10);
                break;
            case 'slideRight':
                el.style.transform = 'translateX(-50px)';
                setTimeout(() => {
                    el.style.transform = 'translateX(0)';
                }, 10);
                break;
            case 'zoomIn':
                el.style.transform = 'scale(0.8)';
                setTimeout(() => {
                    el.style.transform = 'scale(1)';
                }, 10);
                break;
            default: // fadeIn
                break;
        }
    }
}

// ===== HOVER EFFECTS =====
class HoverEffects {
    constructor() {
        this.init();
    }

    init() {
        // Image hover effects
        document.querySelectorAll('[data-hover="zoom"]').forEach((el) => {
            el.style.transition = 'transform 0.5s ease, filter 0.5s ease';
            el.addEventListener('mouseenter', () => {
                el.style.transform = 'scale(1.05)';
                el.style.filter = 'brightness(1.1)';
            });
            el.addEventListener('mouseleave', () => {
                el.style.transform = 'scale(1)';
                el.style.filter = 'brightness(1)';
            });
        });

        // Button hover effects
        document.querySelectorAll('[data-hover="lift"]').forEach((el) => {
            el.style.transition = 'transform 0.3s ease, box-shadow 0.3s ease';
            el.addEventListener('mouseenter', () => {
                el.style.transform = 'translateY(-5px)';
                el.style.boxShadow = '0 10px 20px rgba(255,255,255,0.2)';
            });
            el.addEventListener('mouseleave', () => {
                el.style.transform = 'translateY(0)';
                el.style.boxShadow = 'none';
            });
        });

        // Glow effect
        document.querySelectorAll('[data-hover="glow"]').forEach((el) => {
            el.style.transition = 'box-shadow 0.3s ease, border-color 0.3s ease';
            el.addEventListener('mouseenter', () => {
                el.style.boxShadow = '0 0 20px rgba(255,255,255,0.5)';
                el.style.borderColor = 'rgba(255,255,255,0.8)';
            });
            el.addEventListener('mouseleave', () => {
                el.style.boxShadow = 'none';
                el.style.borderColor = 'rgba(255,255,255,0.5)';
            });
        });
    }
}

// ===== STAGGER ANIMATIONS =====
class StaggerAnimations {
    constructor() {
        this.init();
    }

    init() {
        document.querySelectorAll('[data-stagger]').forEach((container) => {
            const children = container.children;
            const delay = parseInt(container.dataset.staggerDelay, 10) || 100;

            Array.from(children).forEach((child, index) => {
                child.style.opacity = '0';
                child.style.transform = 'translateY(20px)';
                child.style.transition = `all 0.6s ease ${index * delay}ms`;

                const observer = new IntersectionObserver(
                    (entries) => {
                        entries.forEach((entry) => {
                            if (entry.isIntersecting) {
                                Array.from(children).forEach((c, i) => {
                                    setTimeout(() => {
                                        c.style.opacity = '1';
                                        c.style.transform = 'translateY(0)';
                                    }, i * delay);
                                });
                                observer.unobserve(entry.target);
                            }
                        });
                    },
                    { threshold: 0.1 }
                );

                observer.observe(container);
            });
        });
    }
}

// ===== LOOP ANIMATIONS =====
class LoopAnimations {
    constructor() {
        this.init();
    }

    init() {
        // Floating animation
        document.querySelectorAll('[data-loop="float"]').forEach((el) => {
            el.style.animation = 'float 6s ease-in-out infinite';
        });

        // Pulse animation
        document.querySelectorAll('[data-loop="pulse"]').forEach((el) => {
            el.style.animation = 'pulse 2s ease-in-out infinite';
        });

        // Rotate animation
        document.querySelectorAll('[data-loop="rotate"]').forEach((el) => {
            const speed = el.dataset.loopSpeed || '10s';
            el.style.animation = `rotate ${speed} linear infinite`;
        });
    }
}

// ===== PARALLAX SCROLL EFFECT =====
class ParallaxEffect {
    constructor() {
        this.ticking = false;
        this.init();
    }

    init() {
        this.scrollHandler = () => {
            if (!this.ticking) {
                window.requestAnimationFrame(() => {
                    this.updateParallax();
                    this.ticking = false;
                });
                this.ticking = true;
            }
        };
        window.addEventListener('scroll', this.scrollHandler);
    }

    cleanup() {
        if (this.scrollHandler) {
            window.removeEventListener('scroll', this.scrollHandler);
            this.scrollHandler = null;
        }
    }

    updateParallax() {
        const scrolled = window.pageYOffset;

        document.querySelectorAll('[data-parallax-depth]').forEach((el) => {
            const depth = parseFloat(el.dataset.parallaxDepth) || 0.5;
            const movement = scrolled * depth;
            el.style.transform = `translate3d(0, ${movement}px, 0)`;
        });
    }
}

// ===== SMOOTH SCROLL =====
class SmoothScroll {
    constructor() {
        this.init();
    }

    init() {
        document.querySelectorAll('a[href^="#"]').forEach((anchor) => {
            anchor.addEventListener('click', (e) => {
                const href = anchor.getAttribute('href');
                if (href === '#') return;

                e.preventDefault();
                const target = document.querySelector(href);
                if (target) {
                    target.scrollIntoView({
                        behavior: 'smooth',
                        block: 'start',
                    });
                }
            });
        });
    }
}

// ===== INITIALIZE ALL ANIMATIONS =====
document.addEventListener('DOMContentLoaded', () => {
    new ScrollAnimations();
    new EntranceAnimations();
    new HoverEffects();
    new StaggerAnimations();
    new LoopAnimations();
    new ParallaxEffect();
    new SmoothScroll();

    // Add CSS animations dynamically
    const style = document.createElement('style');
    style.textContent = `
        @keyframes float {
            0%, 100% { transform: translateY(0); }
            50% { transform: translateY(-20px); }
        }

        @keyframes pulse {
            0%, 100% { transform: scale(1); opacity: 1; }
            50% { transform: scale(1.05); opacity: 0.8; }
        }

        @keyframes rotate {
            from { transform: rotate(0deg); }
            to { transform: rotate(360deg); }
        }

        [data-scroll-animate].animate-in {
            animation: fadeInUp 0.8s ease forwards;
        }

        @keyframes fadeInUp {
            from {
                opacity: 0;
                transform: translateY(30px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        /* Smooth transitions for all animated elements */
        [data-entrance],
        [data-scroll-animate],
        [data-parallax],
        [data-hover] {
            will-change: transform, opacity;
        }
    `;
    document.head.appendChild(style);

    console.log('ðŸŽ¨ Wix-style animations initialized!');
});

// Supabase Authentication Manager
// Handles login, registration, and user management using Supabase
// Falls back to localStorage if Supabase is not configured

class SupabaseAuthManager {
    constructor() {
        this.supabase = null;
        this.user = null;
        this.session = null;
        this.useSupabase = false;
        this.fallbackToLocalStorage = true;

        this.init();
    }

    async init() {
        // Check if Supabase is configured and available
        if (typeof SUPABASE_CONFIG !== 'undefined' && USE_SUPABASE) {
            try {
                // Load Supabase from CDN if not already loaded
                if (typeof supabase === 'undefined') {
                    await this.loadSupabase();
                }

                // Initialize Supabase client
                this.supabase = supabase.createClient(SUPABASE_CONFIG.url, SUPABASE_CONFIG.anonKey);

                this.useSupabase = true;
                console.log('âœ… Supabase initialized');

                // Check for existing session
                const {
                    data: { session },
                } = await this.supabase.auth.getSession();
                if (session) {
                    this.session = session;
                    await this.loadUser();
                }

                // Listen for auth state changes
                // Store subscription for potential cleanup
                this.authStateSubscription = this.supabase.auth.onAuthStateChange(
                    (event, session) => {
                        console.log('ðŸ” Auth state changed:', event);
                        if (session) {
                            this.session = session;
                            this.loadUser();
                        } else {
                            this.session = null;
                            this.user = null;
                        }
                        this.updateUI();
                    }
                );
            } catch (error) {
                console.error('âœ— Error initializing Supabase:', error);
                console.log('âš ï¸ Falling back to localStorage');
                this.useSupabase = false;
                this.initLocalStorageFallback();
            }
        } else {
            console.log('â„¹ï¸ Supabase not configured, using localStorage fallback');
            this.useSupabase = false;
            this.initLocalStorageFallback();
        }

        this.updateUI();
    }

    async loadSupabase() {
        return new Promise((resolve, reject) => {
            // Check if already loaded
            if (typeof supabase !== 'undefined') {
                resolve();
                return;
            }

            // Load Supabase from CDN
            const script = document.createElement('script');
            script.src =
                'https://cdn.jsdelivr.net/npm/@supabase/supabase-js@2.39.0/dist/umd/supabase.min.js';
            script.onload = () => {
                console.log('âœ… Supabase library loaded');
                resolve();
            };
            script.onerror = () => {
                console.error('âœ— Failed to load Supabase library');
                reject(new Error('Failed to load Supabase'));
            };
            document.head.appendChild(script);
        });
    }

    initLocalStorageFallback() {
        // Initialize localStorage-based auth as fallback
        this.usersStorageKey = 'adriano_users';
        this.initUsersStorage();
        this.token = localStorage.getItem('auth_token');
        if (this.token) {
            this.loadUserFromLocalStorage();
        }
    }

    initUsersStorage() {
        if (!localStorage.getItem(this.usersStorageKey)) {
            localStorage.setItem(this.usersStorageKey, JSON.stringify([]));
        }
    }

    getUsers() {
        this.initUsersStorage();
        const usersJson = localStorage.getItem(this.usersStorageKey);
        return JSON.parse(usersJson || '[]');
    }

    saveUsers(users) {
        try {
            localStorage.setItem(this.usersStorageKey, JSON.stringify(users));
            localStorage.setItem(
                this.usersStorageKey + '_backup',
                JSON.stringify({
                    users: users,
                    timestamp: new Date().toISOString(),
                    version: '1.0',
                })
            );
        } catch (error) {
            console.error('âœ— Error saving users:', error);
            if (error.name === 'QuotaExceededError') {
                localStorage.removeItem(this.usersStorageKey + '_backup');
                localStorage.setItem(this.usersStorageKey, JSON.stringify(users));
            }
        }
    }

    async hashPassword(password) {
        const encoder = new TextEncoder();
        const data = encoder.encode(password);
        const hashBuffer = await crypto.subtle.digest('SHA-256', data);
        const hashArray = Array.from(new Uint8Array(hashBuffer));
        return hashArray.map((b) => b.toString(16).padStart(2, '0')).join('');
    }

    generateToken(user) {
        const payload = {
            id: user.id,
            username: user.username,
            email: user.email,
            exp: Date.now() + 7 * 24 * 60 * 60 * 1000,
        };
        return btoa(JSON.stringify(payload));
    }

    verifyToken(token) {
        try {
            const payload = JSON.parse(atob(token));
            if (payload.exp && payload.exp < Date.now()) {
                return null;
            }
            return payload;
        } catch (_e) {
            return null;
        }
    }

    // Register new user
    async register(username, email, password, fullName) {
        console.log(`ðŸ“ Registering user: ${username}`);

        if (this.useSupabase) {
            try {
                // Validate input
                if (!email || !password) {
                    return { success: false, error: 'Email and password are required' };
                }

                if (password.length < 8) {
                    return { success: false, error: 'Password must be at least 8 characters' };
                }

                // Register with Supabase
                const { data, error } = await this.supabase.auth.signUp({
                    email: email.trim().toLowerCase(),
                    password: password,
                    options: {
                        data: {
                            username: username.trim(),
                            full_name: fullName ? fullName.trim() : username.trim(),
                        },
                    },
                });

                if (error) {
                    console.error('âœ— Supabase registration error:', error);
                    return { success: false, error: error.message || 'Registration failed' };
                }

                if (data.user) {
                    console.log('âœ“ User registered successfully with Supabase');
                    this.user = {
                        id: data.user.id,
                        username: data.user.user_metadata?.username || username,
                        email: data.user.email,
                        fullName: data.user.user_metadata?.full_name || fullName || username,
                    };
                    this.session = data.session;
                    // Store token for compatibility
                    if (data.session && data.session.access_token) {
                        this.token = data.session.access_token;
                        localStorage.setItem('auth_token', data.session.access_token);
                    }
                    this.updateUI();
                    return { success: true, user: this.user };
                }

                // If email confirmation is required
                if (data.user === null) {
                    return {
                        success: true,
                        message: 'Please check your email to confirm your account',
                        user: null,
                    };
                }
            } catch (error) {
                console.error('âœ— Registration error:', error);
                return { success: false, error: 'Registration failed. Please try again.' };
            }
        }

        // Fallback to localStorage
        try {
            if (!username || !email || !password) {
                return { success: false, error: 'Username, email, and password are required' };
            }

            if (username.length < 3) {
                return { success: false, error: 'Username must be at least 3 characters' };
            }

            if (password.length < 8) {
                return { success: false, error: 'Password must be at least 8 characters' };
            }

            const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
            if (!emailRegex.test(email)) {
                return { success: false, error: 'Please enter a valid email address' };
            }

            const users = this.getUsers();

            if (users.find((u) => u.username.toLowerCase() === username.toLowerCase())) {
                return { success: false, error: 'Username already exists' };
            }

            if (users.find((u) => u.email.toLowerCase() === email.toLowerCase())) {
                return { success: false, error: 'Email already registered' };
            }

            const hashedPassword = await this.hashPassword(password);

            const newUser = {
                id: users.length > 0 ? Math.max(...users.map((u) => u.id)) + 1 : 1,
                username: username.trim(),
                email: email.trim().toLowerCase(),
                password: hashedPassword,
                fullName: fullName ? fullName.trim() : username.trim(),
                createdAt: new Date().toISOString(),
                groups: [1],
            };

            users.push(newUser);
            this.saveUsers(users);

            const token = this.generateToken(newUser);

            console.log('âœ“ User registered successfully (localStorage)');
            this.token = token;
            this.user = { ...newUser };
            delete this.user.password;
            localStorage.setItem('auth_token', token);
            localStorage.setItem('auth_user', JSON.stringify(this.user));
            this.updateUI();

            return { success: true, user: this.user };
        } catch (error) {
            console.error('âœ— Registration error:', error);
            return { success: false, error: 'Registration failed. Please try again.' };
        }
    }

    // Login user
    async login(username, password) {
        console.log(`ðŸ”‘ Logging in: ${username}`);

        if (this.useSupabase) {
            try {
                if (!username || !password) {
                    return { success: false, error: 'Email and password are required' };
                }

                // Supabase uses email for login
                // If username doesn't contain @, try to find user by username in localStorage first
                let email = username.trim().toLowerCase();

                if (!email.includes('@')) {
                    // User entered username, not email
                    // Try to find email from localStorage users
                    const users = this.getUsers();
                    const user = users.find(
                        (u) => u.username.toLowerCase() === email || u.email.toLowerCase() === email
                    );
                    if (user && user.email) {
                        email = user.email.toLowerCase();
                    } else {
                        // If not found in localStorage, try username as email (might work if username is email)
                        // But Supabase requires email, so return error
                        return {
                            success: false,
                            error: 'Please use your email address to login. If you registered with a username, use the email you provided during registration.',
                        };
                    }
                }

                const { data, error } = await this.supabase.auth.signInWithPassword({
                    email: email,
                    password: password,
                });

                if (error) {
                    console.error('âœ— Supabase login error:', error);
                    return { success: false, error: error.message || 'Invalid credentials' };
                }

                if (data.user && data.session) {
                    console.log('âœ“ Login successful with Supabase');
                    this.session = data.session;
                    this.user = {
                        id: data.user.id,
                        username:
                            data.user.user_metadata?.username || data.user.email?.split('@')[0],
                        email: data.user.email,
                        fullName:
                            data.user.user_metadata?.full_name || data.user.email?.split('@')[0],
                    };
                    this.session = data.session;
                    // Store token for compatibility
                    if (data.session && data.session.access_token) {
                        this.token = data.session.access_token;
                        localStorage.setItem('auth_token', data.session.access_token);
                    }
                    localStorage.setItem('auth_user', JSON.stringify(this.user));
                    this.updateUI();
                    return { success: true, user: this.user };
                }
            } catch (error) {
                console.error('âœ— Login error:', error);
                return { success: false, error: 'Login failed. Please try again.' };
            }
        }

        // Fallback to localStorage
        try {
            if (!username || !password) {
                return { success: false, error: 'Username and password are required' };
            }

            const users = this.getUsers();
            const user = users.find(
                (u) =>
                    u.username.toLowerCase() === username.toLowerCase() ||
                    u.email.toLowerCase() === username.toLowerCase()
            );

            if (!user) {
                return { success: false, error: 'Invalid credentials' };
            }

            const hashedPassword = await this.hashPassword(password);
            if (hashedPassword !== user.password) {
                return { success: false, error: 'Invalid credentials' };
            }

            const token = this.generateToken(user);

            console.log('âœ“ Login successful (localStorage)');
            const { password: _, ...userWithoutPassword } = user;
            this.token = token;
            this.user = userWithoutPassword;
            localStorage.setItem('auth_token', token);
            localStorage.setItem('auth_user', JSON.stringify(this.user));
            this.updateUI();

            return { success: true, user: this.user };
        } catch (error) {
            console.error('âœ— Login error:', error);
            return { success: false, error: 'Login failed. Please try again.' };
        }
    }

    // Logout user
    async logout() {
        console.log('ðŸ‘‹ Logging out');

        if (this.useSupabase && this.supabase) {
            try {
                // Clean up auth state subscription if it exists
                if (
                    this.authStateSubscription &&
                    this.authStateSubscription.data &&
                    this.authStateSubscription.data.subscription
                ) {
                    this.authStateSubscription.data.subscription.unsubscribe();
                    this.authStateSubscription = null;
                }
                await this.supabase.auth.signOut();
            } catch (error) {
                console.error('âœ— Error signing out from Supabase:', error);
            }
        }

        this.token = null;
        this.user = null;
        this.session = null;
        localStorage.removeItem('auth_token');
        localStorage.removeItem('auth_user');
        this.updateUI();

        const basePath = window.location.pathname.split('/').slice(0, -1).join('/');
        if (basePath && basePath !== '/') {
            window.location.href = basePath + '/index.html';
        } else {
            window.location.href = 'index.html';
        }
    }

    // Load current user
    async loadUser() {
        if (this.useSupabase && this.supabase) {
            try {
                const {
                    data: { user },
                    error,
                } = await this.supabase.auth.getUser();

                if (error) {
                    throw error;
                }

                if (user) {
                    this.user = {
                        id: user.id,
                        username: user.user_metadata?.username || user.email?.split('@')[0],
                        email: user.email,
                        fullName: user.user_metadata?.full_name || user.email?.split('@')[0],
                    };
                    console.log('âœ“ User loaded from Supabase:', this.user.email);
                    return;
                }
            } catch (error) {
                console.error('âœ— Error loading user from Supabase:', error);
            }
        }

        // Fallback to localStorage
        this.loadUserFromLocalStorage();
    }

    loadUserFromLocalStorage() {
        if (!this.token) return;

        try {
            const payload = this.verifyToken(this.token);
            if (!payload) {
                throw new Error('Invalid or expired token');
            }

            const savedUser = localStorage.getItem('auth_user');
            if (savedUser) {
                try {
                    this.user = JSON.parse(savedUser);
                    const users = this.getUsers();
                    const userExists = users.find((u) => u.id === this.user.id);
                    if (userExists) {
                        console.log('âœ“ User loaded from localStorage:', this.user.username);
                        return;
                    }
                } catch (_e) {
                    // Continue
                }
            }

            const users = this.getUsers();
