// Frontend Authentication Manager
// Handles login, registration, token management, and authentication state
// Auto-detects GitLab Pages and uses client-side auth, otherwise uses backend

class AuthManager {
    constructor() {
        // Auto-detect environment
        const isGitLabPages =
            window.location.hostname.includes('gitlab.io') ||
            window.location.hostname.includes('gitlab-pages') ||
            (window.location.hostname !== 'localhost' && window.location.hostname !== '127.0.0.1');

        if (isGitLabPages) {
            console.log('ðŸŒ GitLab Pages detected - Using client-side authentication');
            this.API_URL = null; // No backend on GitLab Pages
            this.useClientSideAuth = true;
            this.usersStorageKey = 'adriano_users';
            this.initUsersStorage();
        } else {
            console.log('ðŸ’» Localhost detected - Using backend authentication');
            this.API_URL = 'http://localhost:3000/api';
            this.useClientSideAuth = false;
        }

        this.token = localStorage.getItem('auth_token');
        this.user = null;
        this.init();
    }

    // Initialize users storage if needed (for client-side auth)
    initUsersStorage() {
        if (!localStorage.getItem(this.usersStorageKey)) {
            localStorage.setItem(this.usersStorageKey, JSON.stringify([]));
        }
    }

    // Get all users from localStorage (for client-side auth)
    getUsers() {
        this.initUsersStorage();
        const usersJson = localStorage.getItem(this.usersStorageKey);
        return JSON.parse(usersJson || '[]');
    }

    // Save users to localStorage (for client-side auth)
    saveUsers(users) {
        try {
            localStorage.setItem(this.usersStorageKey, JSON.stringify(users));
            // Also save a backup timestamp
            localStorage.setItem(
                this.usersStorageKey + '_backup',
                JSON.stringify({
                    users: users,
                    timestamp: new Date().toISOString(),
                    version: '1.0',
                })
            );
            console.log('âœ“ Users saved to localStorage');
        } catch (error) {
            console.error('âœ— Error saving users:', error);
            // If localStorage is full, try to clean up old data
            if (error.name === 'QuotaExceededError') {
                console.warn('âš ï¸ localStorage full, attempting cleanup...');
                try {
                    // Remove old backup
                    localStorage.removeItem(this.usersStorageKey + '_backup');
                    // Try again
                    localStorage.setItem(this.usersStorageKey, JSON.stringify(users));
                } catch (e) {
                    console.error('âœ— Could not save users after cleanup:', e);
                }
            }
        }
    }

    // Simple password hashing using Web Crypto API
    async hashPassword(password) {
        const encoder = new TextEncoder();
        const data = encoder.encode(password);
        const hashBuffer = await crypto.subtle.digest('SHA-256', data);
        const hashArray = Array.from(new Uint8Array(hashBuffer));
        return hashArray.map((b) => b.toString(16).padStart(2, '0')).join('');
    }

    // Generate simple token (for client-side auth)
    generateToken(user) {
        const payload = {
            id: user.id,
            username: user.username,
            email: user.email,
            exp: Date.now() + 7 * 24 * 60 * 60 * 1000, // 7 days
        };
        return btoa(JSON.stringify(payload)); // Base64 encode
    }

    // Verify token (for client-side auth)
    verifyToken(token) {
        try {
            const payload = JSON.parse(atob(token));
            if (payload.exp && payload.exp < Date.now()) {
                return null; // Token expired
            }
            return payload;
        } catch (_e) {
            return null;
        }
    }

    async init() {
        console.log('ðŸ” Auth Manager initialized');
        if (this.token) {
            await this.loadUser();
        }
        this.updateUI();
    }

    // Register new user
    async register(username, email, password, fullName) {
        console.log(`ðŸ“ Registering user: ${username}`);

        // Use client-side authentication on GitLab Pages
        if (this.useClientSideAuth) {
            try {
                // Validation
                if (!username || !email || !password) {
                    return { success: false, error: 'Username, email, and password are required' };
                }

                if (username.length < 3) {
                    return { success: false, error: 'Username must be at least 3 characters' };
                }

                if (password.length < 8) {
                    return { success: false, error: 'Password must be at least 8 characters' };
                }

                // Email validation
                const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
                if (!emailRegex.test(email)) {
                    return { success: false, error: 'Please enter a valid email address' };
                }

                const users = this.getUsers();

                // Check if username already exists
                if (users.find((u) => u.username.toLowerCase() === username.toLowerCase())) {
                    return { success: false, error: 'Username already exists' };
                }

                // Check if email already exists
                if (users.find((u) => u.email.toLowerCase() === email.toLowerCase())) {
                    return { success: false, error: 'Email already registered' };
                }

                // Hash password
                const hashedPassword = await this.hashPassword(password);

                // Create user
                const newUser = {
                    id: users.length > 0 ? Math.max(...users.map((u) => u.id)) + 1 : 1,
                    username: username.trim(),
                    email: email.trim().toLowerCase(),
                    password: hashedPassword,
                    fullName: fullName ? fullName.trim() : username.trim(),
                    createdAt: new Date().toISOString(),
                    groups: [1],
                };

                users.push(newUser);
                this.saveUsers(users);

                // Generate token
                const token = this.generateToken(newUser);

                console.log('âœ“ User registered successfully: ' + username);
                this.token = token;
                this.user = { ...newUser };
                delete this.user.password;
                localStorage.setItem('auth_token', token);
                localStorage.setItem('auth_user', JSON.stringify(this.user));
                this.updateUI();

                return { success: true, user: this.user };
            } catch (error) {
                console.error('âœ— Registration error:', error);
                return { success: false, error: 'Registration failed. Please try again.' };
            }
        }

        // Backend authentication (localhost)
        try {
            const response = await fetch(`${this.API_URL}/auth/register`, {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({ username, email, password, fullName }),
            });

            // Check if response is ok before trying to parse JSON
            if (!response.ok) {
                let errorMessage = 'Registration failed';
                try {
                    const errorData = await response.json();
                    errorMessage = errorData.error || errorMessage;
                } catch (_e) {
                    // If response is not JSON, use status text
                    errorMessage = response.statusText || `Server error (${response.status})`;
                }
                throw new Error(errorMessage);
            }

            const data = await response.json();

            console.log('âœ“ Registration successful');
            this.token = data.token;
            this.user = data.user;
            localStorage.setItem('auth_token', data.token);
            this.updateUI();

            return { success: true, user: data.user };
        } catch (error) {
            console.error('âœ— Registration error:', error);

            // Provide more helpful error messages
            let errorMessage = error.message;
            if (
                error.message.includes('Failed to fetch') ||
                error.message.includes('NetworkError')
            ) {
                errorMessage =
                    'Cannot connect to server. Please make sure the backend server is running on port 3000.';
            } else if (error.message.includes('CORS')) {
                errorMessage = 'CORS error. Please check backend CORS settings.';
            }

            return { success: false, error: errorMessage };
        }
    }

    // Login user
    async login(username, password) {
        console.log(`ðŸ”‘ Logging in: ${username}`);

        // Use client-side authentication on GitLab Pages
        if (this.useClientSideAuth) {
            try {
                if (!username || !password) {
                    return { success: false, error: 'Username and password are required' };
                }

                const users = this.getUsers();

                // Find user by username or email
                const user = users.find(
                    (u) =>
                        u.username.toLowerCase() === username.toLowerCase() ||
                        u.email.toLowerCase() === username.toLowerCase()
                );

                if (!user) {
                    console.log('âœ— User not found');
                    return { success: false, error: 'Invalid credentials' };
                }

                // Verify password
                const hashedPassword = await this.hashPassword(password);
                if (hashedPassword !== user.password) {
                    console.log('âœ— Invalid password');
                    return { success: false, error: 'Invalid credentials' };
                }

                // Generate token
                const token = this.generateToken(user);

                console.log('âœ“ Login successful: ' + user.username);

                // Return user (without password)
                const { password: _, ...userWithoutPassword } = user;
                this.token = token;
                this.user = userWithoutPassword;
                localStorage.setItem('auth_token', token);
                localStorage.setItem('auth_user', JSON.stringify(this.user));
                this.updateUI();

                return { success: true, user: this.user };
            } catch (error) {
                console.error('âœ— Login error:', error);
                return { success: false, error: 'Login failed. Please try again.' };
            }
        }

        // Backend authentication (localhost)
        try {
            const response = await fetch(`${this.API_URL}/auth/login`, {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({ username, password }),
            });

            // Check if response is ok before trying to parse JSON
            if (!response.ok) {
                let errorMessage = 'Login failed';
                try {
                    const errorData = await response.json();
                    errorMessage = errorData.error || errorMessage;
                } catch (_e) {
                    // If response is not JSON, use status text
                    errorMessage = response.statusText || `Server error (${response.status})`;
                }
                throw new Error(errorMessage);
            }

            const data = await response.json();

            console.log('âœ“ Login successful');
            this.token = data.token;
            this.user = data.user;
            localStorage.setItem('auth_token', data.token);
            this.updateUI();

            return { success: true, user: data.user };
        } catch (error) {
            console.error('âœ— Login error:', error);

            // Provide more helpful error messages
            let errorMessage = error.message;
            if (
                error.message.includes('Failed to fetch') ||
                error.message.includes('NetworkError')
            ) {
                errorMessage =
                    'Cannot connect to server. Please make sure the backend server is running on port 3000.';
            } else if (error.message.includes('CORS')) {
                errorMessage = 'CORS error. Please check backend CORS settings.';
            }

            return { success: false, error: errorMessage };
        }
    }

    // Logout user
    logout() {
        console.log('ðŸ‘‹ Logging out');
        this.token = null;
        this.user = null;
        localStorage.removeItem('auth_token');
        localStorage.removeItem('auth_user');
        this.updateUI();
        // Use relative path for GitLab Pages compatibility
        const basePath = window.location.pathname.split('/').slice(0, -1).join('/');
        if (basePath && basePath !== '/') {
            window.location.href = basePath + '/index.html';
        } else {
            window.location.href = 'index.html';
        }
    }

    // Load current user
    async loadUser() {
        if (!this.token) return;

        // Use client-side authentication on GitLab Pages
        if (this.useClientSideAuth) {
            try {
                const payload = this.verifyToken(this.token);
                if (!payload) {
                    throw new Error('Invalid or expired token');
                }

                // Try to get user from localStorage first
                const savedUser = localStorage.getItem('auth_user');
                if (savedUser) {
                    try {
                        this.user = JSON.parse(savedUser);
                        // Verify user still exists
                        const users = this.getUsers();
                        const userExists = users.find((u) => u.id === this.user.id);
                        if (userExists) {
                            console.log('âœ“ User loaded:', this.user.username);
                            return;
                        }
                    } catch (_e) {
                        // Continue to load from users array
                    }
                }

                // Load from users array
                const users = this.getUsers();
                const user = users.find((u) => u.id === payload.id);
                if (user) {
                    const { password: _, ...userWithoutPassword } = user;
                    this.user = userWithoutPassword;
                    localStorage.setItem('auth_user', JSON.stringify(this.user));
                    console.log('âœ“ User loaded:', this.user.username);
                } else {
                    throw new Error('User not found');
                }
            } catch (error) {
                console.error('âœ— Error loading user:', error);
                this.logout();
            }
            return;
        }

        // Backend authentication (localhost)
        try {
            const response = await fetch(`${this.API_URL}/auth/me`, {
                headers: {
                    Authorization: `Bearer ${this.token}`,
                },
            });

            if (!response.ok) {
                throw new Error('Failed to load user');
            }

            this.user = await response.json();
            console.log('âœ“ User loaded:', this.user.username);
        } catch (error) {
            console.error('âœ— Error loading user:', error);
            this.logout();
        }
    }

    // Check if user is authenticated
    isAuthenticated() {
        if (this.useClientSideAuth) {
            return !!this.token && !!this.user && this.verifyToken(this.token) !== null;
        }
        return !!this.token && !!this.user;
    }

    // Get current user
    getCurrentUser() {
        return this.user;
    }

    // Get authorization headers
    getHeaders() {
        return {
            'Content-Type': 'application/json',
            Authorization: `Bearer ${this.token}`,
        };
    }

    // Update UI based on authentication state
    updateUI() {
        const isAuth = this.isAuthenticated();

        // Update login/logout buttons
        const loginButtons = document.querySelectorAll('.login-button');
        const logoutButtons = document.querySelectorAll('.logout-button');
        const memberButtons = document.querySelectorAll('.members-only');

        loginButtons.forEach((btn) => {
            btn.style.display = isAuth ? 'none' : 'block';
        });

        logoutButtons.forEach((btn) => {
            btn.style.display = isAuth ? 'block' : 'none';
        });

        memberButtons.forEach((btn) => {
            btn.style.display = isAuth ? 'block' : 'none';
        });

        // Update user info displays
        const userDisplays = document.querySelectorAll('.user-display');
        userDisplays.forEach((display) => {
            if (this.user) {
                display.textContent = this.user.fullName || this.user.username;
                display.style.display = 'inline';
            } else {
                display.style.display = 'none';
            }
        });

        console.log(`ðŸŽ¨ UI updated - Auth status: ${isAuth}`);
    }
}

