    findProviderWebsite(name) {
        // Enhanced website lookup with better matching
        const cleanName = name.toLowerCase().trim();
        
        // Try exact match first (case-insensitive)
        const exactMatch = Object.keys(this.providerWebsites).find(
            key => key.toLowerCase() === cleanName
        );
        if (exactMatch) {
            return this.providerWebsites[exactMatch];
        }
        
        // Try partial match (provider name contains key or vice versa)
        for (const [key, url] of Object.entries(this.providerWebsites)) {
            const keyLower = key.toLowerCase();
            if (cleanName.includes(keyLower) || keyLower.includes(cleanName)) {
                return url;
            }
        }
        
        // Try to construct URL from provider name (last resort)
        const urlName = cleanName
            .replace(/[^a-z0-9\s]/g, '')
            .replace(/\s+/g, '')
            .replace(/limited|ltd|plc|uk|communications|broadband|fibre|network|telecom|telecoms|group|holdings/gi, '')
            .trim();
        
        // Special cases for common patterns
        if (urlName.includes('bt') || urlName === 'bt') {
            return 'https://www.bt.com';
        }
        if (urlName.includes('ee') || urlName === 'ee') {
            return 'https://ee.co.uk';
        }
        if (urlName.includes('sky') || urlName === 'sky') {
            return 'https://www.sky.com';
        }
        if (urlName.includes('virgin') || urlName === 'virgin') {
            return 'https://www.virginmedia.com';
        }
        if (urlName.includes('talktalk') || urlName === 'talktalk') {
            return 'https://www.talktalk.co.uk';
        }
        if (urlName.includes('vodafone') || urlName === 'vodafone') {
            return 'https://www.vodafone.co.uk';
        }
        if (urlName.includes('plusnet') || urlName === 'plusnet') {
            return 'https://www.plus.net';
        }
        
        // Generic .co.uk pattern (only if we have a reasonable name)
        if (urlName.length > 2 && urlName.length < 30) {
            return `https://www.${urlName}.co.uk`;
        }
        
        return null;
    }

    determineProviderType(name) {
        const lower = name.toLowerCase();
        if (lower.includes('business') || lower.includes('b2b') || lower.includes('enterprise')) {
            return 'business';
        }
        if (lower.includes('rural') || lower.includes('countryside') || lower.includes('community')) {
            return 'rural';
        }
        return 'residential';
    }

    hasFibreInName(name) {
        return name.toLowerCase().includes('fibre') || name.toLowerCase().includes('fiber');
    }

    hasGigabitCapability(name) {
        const lower = name.toLowerCase();
        const gigabitKeywords = [
            'gigabit', 'giga', 'gig', '1gbps', '1000mbps', 'hyperoptic', 
            'gigaclear', 'community fibre', 'g.network', 'brsk', 'youfibre',
            'giganet', 'lit fibre', 'trooli', 'toob', 'lightning', 'fibrus',
            'zzoomm', 'yayzi', 'truespeed', 'swish', 'lightspeed', 'fresh',
            'fibrely', 'fibrenest', 'fusion', 'clearfibre', 'brighton', 'brillband',
            'brawband', 'befibre', 'gigaloch', 'gigability', 'gigabeam', 'hey',
            'rocket', 'wefibre', 'westfibre', 'york', 'open fibre'
        ];
        return gigabitKeywords.some(keyword => lower.includes(keyword));
    }

    isRuralProvider(name) {
        const ruralKeywords = ['rural', 'countryside', 'community', 'village', 'b4rn', 'b4sh'];
        return ruralKeywords.some(keyword => name.toLowerCase().includes(keyword));
    }

    isBusinessProvider(name) {
        const businessKeywords = ['business', 'b2b', 'enterprise', 'commercial', 'corporate'];
        return businessKeywords.some(keyword => name.toLowerCase().includes(keyword));
    }

