        // Add event listeners
        const overlay = modal.querySelector('.viewer-overlay');
        const closeBtn = modal.querySelector('.close-btn');
        const refreshBtn = modal.querySelector('.refresh-btn');
        const fullscreenBtn = modal.querySelector('.fullscreen-btn');
        
        const closeHandler = () => this.closeViewer();
        const refreshHandler = () => {
            const iframe = modal.querySelector('.provider-iframe');
            if (iframe) {
                iframe.src = iframe.src; // Reload iframe
            }
        };
        const fullscreenHandler = () => this.toggleFullscreen();
        
        overlay.addEventListener('click', closeHandler);
        closeBtn.addEventListener('click', closeHandler);
        refreshBtn.addEventListener('click', refreshHandler);
        fullscreenBtn.addEventListener('click', fullscreenHandler);
        
        // Store handlers for cleanup
        modal._closeHandler = closeHandler;
        modal._refreshHandler = refreshHandler;
        modal._fullscreenHandler = fullscreenHandler;
        
        // Close on Escape key
        const escapeHandler = (e) => {
            if (e.key === 'Escape') {
                this.closeViewer();
            }
        };
        document.addEventListener('keydown', escapeHandler);
        modal._escapeHandler = escapeHandler;
        
        return modal;
    }

    closeViewer() {
        const modal = document.getElementById('provider-viewer-modal');
        if (modal) {
            modal.style.display = 'none';
            document.body.style.overflow = ''; // Restore scrolling
            
            // Clear iframe to stop loading
            const iframe = modal.querySelector('.provider-iframe');
            if (iframe) {
                iframe.src = 'about:blank';
            }
        }
    }

    toggleFullscreen() {
        const modal = document.getElementById('provider-viewer-modal');
        if (!modal) return;
        
        const container = modal.querySelector('.viewer-container');
        if (!container) return;
        
        if (!document.fullscreenElement) {
            container.requestFullscreen().catch(err => {
                console.warn('Could not enter fullscreen:', err);
            });
        } else {
            document.exitFullscreen();
        }
    }

    cleanup() {
        // Clear timeout
        if (this.searchTimeout) {
            clearTimeout(this.searchTimeout);
            this.searchTimeout = null;
        }
        
        // Remove event listeners (if elements still exist)
        const searchInput = document.getElementById('provider-search');
        const searchBtn = document.getElementById('search-btn');
        const speedFilter = document.getElementById('speed-filter');
        const typeFilter = document.getElementById('type-filter');
        const clearFilters = document.getElementById('clear-filters');
        const postcodeInput = document.getElementById('postcode-input');
        const checkPostcodeBtn = document.getElementById('check-postcode-btn');
        
        if (searchInput && this.eventHandlers.debouncedSearch) {
            searchInput.removeEventListener('input', this.eventHandlers.debouncedSearch);
        }
        if (searchBtn && this.eventHandlers.searchClick) {
            searchBtn.removeEventListener('click', this.eventHandlers.searchClick);
        }
        if (searchInput && this.eventHandlers.searchKeypress) {
            searchInput.removeEventListener('keypress', this.eventHandlers.searchKeypress);
        }
        if (speedFilter && this.eventHandlers.speedFilterChange) {
            speedFilter.removeEventListener('change', this.eventHandlers.speedFilterChange);
        }
        if (typeFilter && this.eventHandlers.typeFilterChange) {
            typeFilter.removeEventListener('change', this.eventHandlers.typeFilterChange);
        }
        if (clearFilters && this.eventHandlers.clearFiltersClick) {
            clearFilters.removeEventListener('click', this.eventHandlers.clearFiltersClick);
        }
        if (checkPostcodeBtn && this.eventHandlers.checkPostcodeClick) {
            checkPostcodeBtn.removeEventListener('click', this.eventHandlers.checkPostcodeClick);
        }
        if (postcodeInput && this.eventHandlers.postcodeKeypress) {
            postcodeInput.removeEventListener('keypress', this.eventHandlers.postcodeKeypress);
        }
        
        // Close modal if open
        this.closeViewer();
        
        // Remove modal from DOM
        const modal = document.getElementById('provider-viewer-modal');
        if (modal) {
            if (modal._escapeHandler) {
                document.removeEventListener('keydown', modal._escapeHandler);
            }
            modal.remove();
        }
    }

