                                ` : ''}
                            </div>
                        `).join('')}
                    </div>
                    <p style="color: rgba(255,255,255,0.7); margin-top: 1.5rem; font-size: 0.9rem;">
                        ðŸ’¡ Tip: Contact providers directly for accurate pricing and availability in your area.
                    </p>
                `;
            }
        }, 1500);
