    play() {
        // Ensure we always return a Promise
        if (!this.audio) {
            console.warn('âš ï¸ Cannot play: audio object not initialized');
            return Promise.reject(new Error('Audio object not initialized'));
        }
        
        const playPromise = this.audio.play();
        
        // Ensure we always return a Promise (audio.play() may return undefined in older browsers)
        const promise = playPromise !== undefined ? playPromise : Promise.resolve();
        
        return promise.then(() => {
            // Playback started successfully
            this.isPlaying = true;
            const playPauseBtn = document.getElementById('play-pause');
            if (playPauseBtn) {
                playPauseBtn.innerHTML = 'â¸';
            }
            this.savePlayerState();
            console.log('ðŸŽµ Playing:', this.tracks[this.currentTrackIndex].name);
        }).catch(err => {
            console.warn('âš ï¸ Playback prevented:', err.name, err.message);
            this.isPlaying = false;
            const playPauseBtn = document.getElementById('play-pause');
            if (playPauseBtn) {
                playPauseBtn.innerHTML = 'â–¶';
            }
            
            // Show user-friendly message
            const currentTrackEl = document.getElementById('current-track');
            if (currentTrackEl) {
                if (err.name === 'NotAllowedError') {
                    currentTrackEl.innerHTML = '<span style="color: #ffa500;">Click â–¶ to start music</span>';
                } else {
                    currentTrackEl.innerHTML = '<span style="color: #ff4444;">Error loading track</span>';
                }
            }
            throw err; // Re-throw to allow caller to catch
        });
    }
    
    pause() {
        this.audio.pause();
