    previousTrack() {
        this.currentTrackIndex = (this.currentTrackIndex - 1 + this.tracks.length) % this.tracks.length;
        this.loadTrack();
    }
    
    nextTrack() {
        this.currentTrackIndex = (this.currentTrackIndex + 1) % this.tracks.length;
        this.loadTrack();
    }
    
    async loadTrack() {
        const track = this.tracks[this.currentTrackIndex];
        const wasPlaying = this.isPlaying;
        
        // Update track display
        this.updateTrackDisplay();
        
        console.log('ðŸ”„ Loading track:', track.name, `(${this.currentTrackIndex + 1}/${this.tracks.length})`);
        console.log('ðŸ”„ Primary URL:', track.url);
        console.log('ðŸ”„ Fallback URL:', track.fallbackUrl);
        
        // Clear pending state when manually switching tracks
        this.pendingState = null;
        
        // Try primary URL first
        try {
            this.audio.src = track.url;
            document.getElementById('current-track').textContent = track.name;
            
            // Test if URL is accessible
            await this.testTrackURL(track.url, track.name);
        } catch (error) {
            console.warn('âš ï¸ Primary URL failed, trying fallback:', error);
            
            // Try fallback URL
            if (track.fallbackUrl) {
                this.audio.src = track.fallbackUrl;
                console.log('ðŸ”„ Using fallback URL:', track.fallbackUrl);
            }
        }
        
        if (wasPlaying) {
            // Wait a bit for source to load
            setTimeout(() => {
                this.play();
            }, 100);
        }
        
        this.savePlayerState();
    }
    
