    exportData(format, scope) {
        const data = scope === 'all' ? this.db.allData : this.db.filteredData;
        
        if (format === 'csv') {
            this.exportToCSV(data);
        } else {
            this.exportToJSON(data);
        }

        document.getElementById('export-menu')?.remove();
