            setTimeout(() => {
                this.addActionButtonsToCards();
                this.updateFavoriteButtons();
            }, 100);
        };
        
        // Also listen for mutations in case cards are added dynamically
        const observer = new MutationObserver(() => {
            const cards = document.querySelectorAll('.planet-card');
            if (cards.length > 0) {
                this.addActionButtonsToCards();
                this.updateFavoriteButtons();
