    // Load data from kepler_data_parsed.js and large dataset
    async loadData() {
        console.log('ðŸš€ Loading Kepler database...');
        
        // Show loading message while data loads
        const container = document.getElementById('nasa-data-container');
        if (container) {
            container.innerHTML = `
