                    <p style="opacity: 0.8; margin-top: 1rem;">Loading Kepler data and large exoplanet dataset...</p>
                </div>
            `;
        }
        
        // Load Kepler database first
        let keplerData = [];
        if (typeof KEPLER_DATABASE !== 'undefined') {
            // Use ALL planets from parsed database (not just high-quality)
            // This ensures we get all 9,564+ exoplanets
            const allKeplerPlanets = KEPLER_DATABASE.allPlanets || KEPLER_DATABASE.highQuality || [];
            keplerData = allKeplerPlanets.map(planet => ({
                kepid: planet.kepid,
                kepoi_name: planet.kepoi_name || `KOI-${planet.kepid}`,
                kepler_name: planet.kepler_name || null,
                status: planet.status,
                score: planet.score || 0,
                radius: this.estimateRadius(planet),
                mass: this.estimateMass(planet),
                distance: this.estimateDistance(planet.kepid),
                disc_year: this.estimateDiscoveryYear(planet),
                type: this.classifyPlanet(this.estimateRadius(planet)),
                availability: 'available', // All planets start as available
                source: 'kepler'
            }));
            
            console.log(`âœ… Loaded ${keplerData.length} exoplanets from Kepler database`);
        } else {
            // Fallback sample data
            keplerData = this.generateSampleData(100);
            console.log('âš ï¸ Using sample data (100 planets)');
        }
        
        // Start with Kepler data
        this.allData = [...keplerData];
        
        // Try to load large dataset
        await this.loadLargeDataset();
        
        // Merge datasets (avoid duplicates by kepid)
        this.mergeDatasets();
        
        this.filteredData = [...this.allData];
        this.calculateStatistics();
        
        // Update statistics display after data is loaded
        this.createStatsSection();
        
        // Update UI
        if (container) {
            container.innerHTML = ''; // Clear loading message
        }
        
        // Recreate search bar and filters with updated stats
