                if (filterStatus) filterStatus.value = 'all';
                if (filterType) filterType.value = 'all';
                if (filterAvailability) filterAvailability.value = 'all';
                this.applyFilters();
            });
        }
    }

    // Apply all filters
    applyFilters() {
        // Always search in allData which contains all merged exoplanets
        let dataToFilter = this.allData;

        // Apply search filter if search term exists
        if (this.searchTerm && this.searchTerm.length >= 2) {
            const searchLower = this.searchTerm.toLowerCase();
            dataToFilter = this.allData.filter(planet => {
                // Search in all relevant fields
                const matchesKepoi = planet.kepoi_name && planet.kepoi_name.toLowerCase().includes(searchLower);
                const matchesKepler = planet.kepler_name && planet.kepler_name.toLowerCase().includes(searchLower);
                const matchesKepid = planet.kepid && planet.kepid.toString().includes(this.searchTerm);
                const matchesType = planet.type && planet.type.toLowerCase().includes(searchLower);
                const matchesStatus = planet.status && planet.status.toLowerCase().includes(searchLower);
                
                return matchesKepoi || matchesKepler || matchesKepid || matchesType || matchesStatus;
            });
        }

        // Apply other filters
        this.filteredData = dataToFilter.filter(planet => {
            // Status filter - handle 'CONFIRMED', 'Confirmed Planet', 'CANDIDATE', etc.
            let matchesStatus = true;
            if (this.activeFilters.status !== 'all') {
                const planetStatus = planet.status || '';
                const planetStatusUpper = planetStatus.toUpperCase();
                const filterStatusUpper = this.activeFilters.status.toUpperCase();
                
                if (filterStatusUpper === 'CONFIRMED') {
                    // Match "CONFIRMED", "Confirmed Planet", "CONFIRMED PLANET", etc.
                    matchesStatus = planetStatusUpper.includes('CONFIRMED') || 
                                   planetStatusUpper === 'CONFIRMED PLANET' ||
                                   planetStatus === 'Confirmed Planet';
                } else if (filterStatusUpper === 'CANDIDATE') {
                    // Match "CANDIDATE" - but exclude confirmed and false positives
                    matchesStatus = (planetStatusUpper.includes('CANDIDATE') || planetStatus === 'CANDIDATE') &&
                                   !planetStatusUpper.includes('CONFIRMED') &&
                                   !planetStatusUpper.includes('FALSE');
                } else {
                    matchesStatus = planetStatusUpper.includes(filterStatusUpper);
                }
            }

            // Type filter
            const matchesType = this.activeFilters.type === 'all' || 
                planet.type === this.activeFilters.type;

            // Availability filter
            const matchesAvailability = this.activeFilters.availability === 'all' || 
                planet.availability === this.activeFilters.availability;

            return matchesStatus && matchesType && matchesAvailability;
        });

        // Update search count
        const searchCount = document.getElementById('search-count');
        if (searchCount) {
            searchCount.textContent = `${this.filteredData.length} result${this.filteredData.length !== 1 ? 's' : ''}`;
        }

        // Reset to first page
        this.currentPage = 1;
        this.renderPage();
    }

