/**
 * Download file from Google Drive
 */
async function downloadFile(driveId, filename, trackName) {
    const outputPath = path.join(AUDIO_DIR, filename);
    
    // Skip if already exists
    if (fs.existsSync(outputPath)) {
        console.log(`âœ… ${trackName} already exists`);
        return true;
    }
    
    console.log(`ðŸ“¥ Downloading ${trackName}...`);
    
    try {
        const url = `https://drive.google.com/uc?export=download&id=${driveId}`;
        
        const response = await axios({
            method: 'get',
            url: url,
            responseType: 'stream',
            timeout: 120000,
            maxRedirects: 5
        });
        
        const writer = fs.createWriteStream(outputPath);
        response.data.pipe(writer);
        
        return new Promise((resolve, reject) => {
            writer.on('finish', () => {
                const stats = fs.statSync(outputPath);
                const sizeMB = (stats.size / (1024 * 1024)).toFixed(2);
                console.log(`âœ… ${trackName} downloaded (${sizeMB} MB)`);
                resolve(true);
            });
            writer.on('error', reject);
        });
        
    } catch (error) {
        console.error(`âŒ Error downloading ${trackName}:`, error.message);
        return false;
    }
}

