/**
 * Ruffle Games Manager
 * Handles SWF game loading and playback for 1122+ games
 * Enhanced with comprehensive error debugging
 */

class RuffleGamesManager {
    constructor() {
        this.games = [];
        this.filteredGames = [];
        this.currentGame = null;
        this.rufflePlayer = null;
        this.debugMode = true; // Enable detailed logging
        this.init();
    }

    async init() {
        try {
            this.log('ðŸŽ® Initializing Ruffle Games Manager...', 'info');
            await this.loadGames();
            this.setupEventListeners();
            this.renderGames(); // FIXED: was "render Games()" with space
            this.log(`âœ… Initialization complete! ${this.games.length} games loaded`, 'success');
        } catch (error) {
            this.log(`âŒ Initialization failed: ${error.message}`, 'error');
            this.showError('Failed to initialize games system', error);
        }
    }

    log(message, level = 'info') {
        if (!this.debugMode) return;

        const styles = {
            info: 'color: #4A90E2',
            success: 'color: #7ED321',
            warning: 'color: #F5A623',
            error: 'color: #D0021B'
        };

        console.log(`%c[Games] ${message}`, styles[level] || styles.info);
    }

    async loadGames() {
        try {
            this.log('ðŸ“¥ Loading games manifest...', 'info');
            
            // Try multiple paths for games-manifest.json (GitLab Pages compatibility)
            const basePath = window.location.pathname.substring(0, window.location.pathname.lastIndexOf('/')) || '';
            const manifestPaths = [
                'games-manifest.json',
                './games-manifest.json',
                '/games-manifest.json',
                `${basePath}/games-manifest.json`,
                `${window.location.origin}/games-manifest.json`,
                'games/games-manifest.json',
                `${basePath}/games/games-manifest.json`
            ];
            
            let response = null;
            let lastError = null;
            
            for (const manifestPath of manifestPaths) {
                try {
                    this.log(`ðŸ” Trying manifest path: ${manifestPath}`, 'info');
                    response = await fetch(manifestPath, {
                        method: 'GET',
                        cache: 'no-cache',
                        headers: {
                            'Accept': 'application/json'
                        }
                    });
                    
                    if (response.ok) {
                        this.log(`âœ… Found manifest at: ${manifestPath}`, 'success');
                        break;
                    } else {
                        this.log(`âš ï¸ Manifest not found at: ${manifestPath} (${response.status} ${response.statusText})`, 'warning');
                    }
                } catch (err) {
                    lastError = err;
                    this.log(`âš ï¸ Error fetching ${manifestPath}: ${err.message}`, 'warning');
                    continue;
                }
            }

            if (!response || !response.ok) {
                const errorMsg = `Failed to load games manifest from all paths. Last error: ${lastError ? lastError.message : `HTTP ${response?.status || 'unknown'}`}`;
                throw new Error(errorMsg);
            }

            this.games = await response.json();
            this.filteredGames = [...this.games];
            this.log(`âœ… Loaded ${this.games.length} games from manifest`, 'success');

            // Validate games data
            if (!Array.isArray(this.games) || this.games.length === 0) {
                throw new Error('Games manifest is empty or invalid');
            }

        } catch (error) {
            this.log(`âŒ Error loading games manifest: ${error.message}`, 'error');
            this.showError('Failed to load games list', error);
            throw error;
        }
    }

    setupEventListeners() {
        try {
            this.log('ðŸ”§ Setting up event listeners...', 'info');

            // Search functionality
            const searchInput = document.getElementById('game-search');
            if (searchInput) {
                searchInput.addEventListener('input', (e) => {
                    this.log(`ðŸ” Search: "${e.target.value}"`, 'info');
                    this.filterGames(e.target.value);
                });
            } else {
                this.log('âš ï¸ Search input not found', 'warning');
            }

            // Game card clicks (delegated)
            const gamesGrid = document.getElementById('games-grid');
            if (gamesGrid) {
                gamesGrid.addEventListener('click', (e) => {
                    const gameCard = e.target.closest('.game-card');
                    if (gameCard) {
                        const gameFile = gameCard.dataset.game;
                        const gameName = gameCard.dataset.name;
                        this.log(`ðŸŽ¯ Game clicked: ${gameName}`, 'info');
                        this.playGame(gameFile, gameName);
                    }
                });
            } else {
                this.log('âš ï¸ Games grid not found', 'warning');
            }

            // Modal close buttons
            const closeModalBtn = document.getElementById('close-game-modal');
            const closeGameBtn = document.getElementById('close-game-btn');
            const gameModal = document.getElementById('game-modal');

            if (closeModalBtn) closeModalBtn.addEventListener('click', () => this.closeGame());
            if (closeGameBtn) closeGameBtn.addEventListener('click', () => this.closeGame());
            if (gameModal) {
                gameModal.addEventListener('click', (e) => {
                    if (e.target === gameModal) this.closeGame();
                });
            }

            // Fullscreen button
            const fullscreenBtn = document.getElementById('fullscreen-btn');
            if (fullscreenBtn) {
                fullscreenBtn.addEventListener('click', () => this.toggleFullscreen());
            }

            // Escape key to close modal
            document.addEventListener('keydown', (e) => {
                if (e.key === 'Escape' && gameModal && gameModal.style.display !== 'none') {
                    this.closeGame();
                }
            });

            this.log('âœ… Event listeners set up successfully', 'success');
        } catch (error) {
            this.log(`âŒ Error setting up event listeners: ${error.message}`, 'error');
        }
    }

    filterGames(searchTerm) {
        try {
            const term = searchTerm.toLowerCase().trim();
            this.filteredGames = this.games.filter(game =>
                game.name.toLowerCase().includes(term)
            );
            this.log(`ðŸ” Filtered to ${this.filteredGames.length} games`, 'info');
            this.renderGames();
            this.updateGameCount();
        } catch (error) {
            this.log(`âŒ Error filtering games: ${error.message}`, 'error');
        }
    }

    updateGameCount() {
        try {
            const visibleCount = document.getElementById('visible-count');
            if (visibleCount) {
                visibleCount.textContent = this.filteredGames.length;
            }
        } catch (error) {
            this.log(`âŒ Error updating count: ${error.message}`, 'error');
        }
    }

    renderGames() {
        try {
            this.log(`ðŸŽ¨ Rendering ${this.filteredGames.length} games...`, 'info');

            const gamesGrid = document.getElementById('games-grid');
            const loadingIndicator = document.getElementById('loading-indicator');

            if (!gamesGrid) {
                throw new Error('Games grid element not found');
            }

            if (loadingIndicator) {
                loadingIndicator.style.display = 'none';
            }

            if (this.filteredGames.length === 0) {
                gamesGrid.innerHTML = '<div class="no-games"><p>No games found. Try a different search term.</p></div>';
                return;
            }

            gamesGrid.innerHTML = this.filteredGames.map(game => `
                <div class="game-card" data-game="${game.file}" data-name="${game.name}">
                    <div class="game-thumbnail">
                        <div class="play-icon">â–¶ï¸</div>
                        <div class="game-name">${this.formatGameName(game.name)}</div>
                    </div>
                    <div class="game-size">${Math.round(game.size)} KB</div>
                </div>
            `).join('');

            this.log(`âœ… Rendered ${this.filteredGames.length} game cards`, 'success');
        } catch (error) {
            this.log(`âŒ Error rendering games: ${error.message}`, 'error');
            this.showError('Failed to display games', error);
        }
    }

    formatGameName(name) {
        // Clean up game names for display
        return name
            .replace(/[_-]/g, ' ')
            .replace(/\b\w/g, l => l.toUpperCase())
            .substring(0, 50) + (name.length > 50 ? '...' : '');
    }

    async playGame(gameFile, gameName) {
        try {
            this.log(`ðŸŽ® Loading game: ${gameName}`, 'info');

            const modal = document.getElementById('game-modal');
            const modalTitle = document.getElementById('game-modal-title');
            const gameContainer = document.getElementById('game-container');

            if (!modal || !gameContainer) {
                throw new Error('Modal elements not found');
            }

            // Show modal
            modal.style.display = 'flex';
            document.body.style.overflow = 'hidden';

            // Set title
            if (modalTitle) {
                modalTitle.textContent = this.formatGameName(gameName);
            }

            // Clear previous game
            gameContainer.innerHTML = '<div style="color: white; text-align: center; padding: 2rem;">Loading game...</div>';

            // Check if Ruffle is available
            if (!window.RufflePlayer) {
                throw new Error('Ruffle player not loaded. Please refresh the page.');
            }

            // Create Ruffle player
            const ruffle = window.RufflePlayer.newest();
            this.rufflePlayer = ruffle.createPlayer();

            // Style the player
            this.rufflePlayer.style.width = '100%';
            this.rufflePlayer.style.height = '100%';

            // Clear loading message and add player
            gameContainer.innerHTML = '';
            gameContainer.appendChild(this.rufflePlayer);

            // Load the SWF
            this.log(`ðŸ“‚ Loading SWF file: ${gameFile}`, 'info');
            await this.rufflePlayer.load(gameFile);

            this.currentGame = { file: gameFile, name: gameName };
            this.log(`âœ… Game loaded successfully: ${gameName}`, 'success');

        } catch (error) {
            this.log(`âŒ Error loading game: ${error.message}`, 'error');
            const gameContainer = document.getElementById('game-container');
            if (gameContainer) {
                gameContainer.innerHTML = `
                    <div style="display: flex; flex-direction: column; align-items: center; justify-content: center; height: 100%; color: white; text-align: center; padding: 2rem;">
                        <h3>âš ï¸ Game Loading Error</h3>
                        <p>Unable to load the game. Please try again or choose another game.</p>
                        <p style="font-size: 0.9rem; opacity: 0.7; margin-top: 1rem;">Error: ${error.message}</p>
                        <p style="font-size: 0.8rem; opacity: 0.5; margin-top: 0.5rem;">Game file: ${this.currentGame?.file || 'unknown'}</p>
                    </div>
                `;
            }
        }
    }

    closeGame() {
        try {
            this.log('ðŸšª Closing game...', 'info');

            const modal = document.getElementById('game-modal');
            const gameContainer = document.getElementById('game-container');

            if (!modal) return;

            // Remove Ruffle player
            if (this.rufflePlayer) {
                this.rufflePlayer.remove();
                this.rufflePlayer = null;
            }

            // Clear container
            if (gameContainer) {
                gameContainer.innerHTML = '';
            }

            this.currentGame = null;
            modal.style.display = 'none';
            document.body.style.overflow = '';

            this.log('âœ… Game closed', 'success');
        } catch (error) {
