                    if (!response.ok) {
                        throw new Error(`Failed to fetch image: ${response.status} ${response.statusText}`);
                    }

                    const blob = await response.blob();
                    console.log(`ðŸ“¦ Blob created: ${(blob.size / 1024).toFixed(2)} KB, type: ${blob.type}`);
                    
