            { path: 'Medieval II - Total War/mods/', name: 'mods/', category: 'mods', isDirectory: true },
            
            // Miles audio
            { path: 'Medieval II - Total War/miles/', name: 'miles/', category: 'audio', isDirectory: true }
        ];
    }

    renderDownloadOptions() {
        const container = document.getElementById('download-options');
        if (!container) return;

        // Group files by category
        const grouped = this.groupFilesByCategory();
        
        container.innerHTML = '';
        
        Object.keys(grouped).forEach(category => {
            const categoryDiv = document.createElement('div');
            categoryDiv.className = 'download-category';
            
            const categoryTitle = document.createElement('h3');
            categoryTitle.textContent = this.getCategoryName(category);
            categoryDiv.appendChild(categoryTitle);
            
            const filesList = document.createElement('div');
            filesList.className = 'files-list';
            
            grouped[category].forEach(file => {
                const fileItem = this.createFileItem(file);
                filesList.appendChild(fileItem);
            });
            
            categoryDiv.appendChild(filesList);
            container.appendChild(categoryDiv);
        });
    }

    groupFilesByCategory() {
        const grouped = {};
        this.gameFiles.forEach(file => {
            const category = file.category || 'other';
            if (!grouped[category]) {
                grouped[category] = [];
            }
            grouped[category].push(file);
        });
        return grouped;
    }

    getCategoryName(category) {
        const names = {
            'executable': 'ðŸŽ® Executable Files',
            'library': 'ðŸ“š Library Files (DLL)',
            'config': 'âš™ï¸ Configuration Files',
            'documentation': 'ðŸ“„ Documentation',
            'redistributable': 'ðŸ”§ DirectX Redistributables',
            'data': 'ðŸ’¾ Game Data',
            'mods': 'ðŸŽ¯ Mods & DLCs',
            'audio': 'ðŸ”Š Audio Files',
            'other': 'ðŸ“¦ Other Files'
        };
        return names[category] || 'ðŸ“¦ Other Files';
    }

    createFileItem(file) {
        const item = document.createElement('div');
        item.className = 'file-item';
        
        const fileInfo = document.createElement('div');
        fileInfo.className = 'file-info';
        
        const fileName = document.createElement('span');
        fileName.className = 'file-name';
        fileName.textContent = file.name;
        fileInfo.appendChild(fileName);
        
        if (file.size) {
            const fileSize = document.createElement('span');
            fileSize.className = 'file-size';
            fileSize.textContent = file.size;
            fileInfo.appendChild(fileSize);
        }
        
        item.appendChild(fileInfo);
        
        if (!file.isDirectory) {
            const downloadBtn = document.createElement('button');
            downloadBtn.className = 'download-file-btn';
            downloadBtn.textContent = 'Download';
            downloadBtn.addEventListener('click', () => {
                this.downloadFile(file.path, file.name);
            });
            item.appendChild(downloadBtn);
        } else {
            const dirNote = document.createElement('span');
            dirNote.className = 'directory-note';
            dirNote.textContent = 'ðŸ“ Directory (contains multiple files)';
            item.appendChild(dirNote);
        }
        
        return item;
    }

    downloadFile(filePath, fileName) {
        const fullPath = `${this.gameBasePath}${filePath}`;
        console.log(`â¬‡ï¸ Downloading: ${fullPath}`);
        
        // Create a temporary link and trigger download
        const link = document.createElement('a');
        link.href = fullPath;
        link.download = fileName;
        link.style.display = 'none';
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
    }

    setupDownloadButtons() {
        const downloadAllBtn = document.getElementById('download-all-btn');
        if (downloadAllBtn) {
            downloadAllBtn.addEventListener('click', () => {
                this.downloadAllFiles();
            });
        }
    }

    async downloadAllFiles() {
        const btn = document.getElementById('download-all-btn');
        if (btn) {
            btn.disabled = true;
            btn.innerHTML = '<span class="btn-icon">â³</span><span class="btn-text">Preparing downloads...</span>';
        }
        
        console.log('ðŸ“¦ Starting batch download of all files...');
        
        // Download files one by one with a small delay
        const filesToDownload = this.gameFiles.filter(f => !f.isDirectory);
        
        for (let i = 0; i < filesToDownload.length; i++) {
            const file = filesToDownload[i];
            await new Promise(resolve => setTimeout(resolve, 500)); // Small delay between downloads
            this.downloadFile(file.path, file.name);
        }
        
        if (btn) {
            btn.disabled = false;
            btn.innerHTML = '<span class="btn-icon">ðŸ“¦</span><span class="btn-text">Download All Game Files</span>';
        }
        
        alert(`âœ… Download initiated for ${filesToDownload.length} files. Please check your browser's download folder.`);
    }
}

